import React from 'react';

const TapFork = () => {
    return (
      <div>
        <Typography className={text.paragraph}>
          {t('Tap & Fork is an application that allows people to find restaurants. Conceptually it is similar to applications like Yelp, OpenTable or Zomato, Tap & Fork is built to address some of the shortcomings of the existing applications to make the pricing strategy more attractive to restaurant owners and to allow them to fully control their marketing campaigns. With Tap & Fork, restaurant owners can easily upload images, create coupons, and run promotions.')}
        </Typography>

      </div>
    );
  }


export default TapFork;
